import React from 'react';
import { Link } from 'react-router-dom';

const LinkIcon = ({icon,iconname, ...props}) =>{
    return(
    <Link to="">
    <img src={icon} alt={iconname}/>
    </Link>
    );
}

export default LinkIcon;
